        Контакты
      </Typography>
      <Typography variant={'h6'} sx={contactsHeaderStyles}>
        Телефон
      </Typography>
      <Typography variant={'body2'} sx={contactsTextStyles}>
        +7 903 682 0431
      </Typography>
      {/*<Typography variant={'body1'} sx={contactsTextStyles}>*/}
      {/*  +7 (496) 514-29-56*/}
      {/*</Typography>*/}
      <Typography variant={'h6'} sx={contactsHeaderStyles}>
        Email
      </Typography>
      <Link variant={'body2'} href={'http://intekart.ru/'} underline={'none'}>
        intekart@intekart.ru
      </Link>
      <Typography variant={'h6'} sx={contactsHeaderStyles}>
        Адрес
      </Typography>
      <Typography variant={'body2'} sx={contactsTextStyles}>
        141070, Россия, МО, г. Королев, Циолковского 27, офис 3
      </Typography>
    </Box>
  );
}

export default Contacts;
